import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a modal: Click on the first product card to open the product detail modal
    await page.waitForSelector('.product-card', { timeout: 5000 });
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) throw new Error('No product cards found');
    await productCards[0].click();

    // Wait for the modal to appear
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // The modal should be visible (display: block)
    const modalVisible = await page.evaluate(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    });
    if (!modalVisible) throw new Error('Product modal did not appear');

    // Screenshot of modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Press Escape to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be hidden
    await page.waitForTimeout(300); // Small delay for animation
    const modalClosed = await page.evaluate(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display === 'none';
    });

    // Screenshot after closing modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    return {
      success: modalClosed,
      action: "Opened product modal and closed it with Escape key",
      extractedData: {
        modalWasVisible: modalVisible,
        modalIsClosed: modalClosed
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
